{
    if(typeof req.headers.authorization =='undefined'){
        res.send({"error":"Basic autentication not send"});
        res.end();
    }else
    {
        if((req.headers.authorization.indexOf("Basic")==0))
        {
                const base64Credentials =  req.headers.authorization.split(' ')[1];
